use acme_company;
create table employees (
	employee_id INT auto_increment PRIMARY KEY NOT NULL,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	salary INT NOT NULL,
	date_hire VARCHAR(30) NOT NULL,
	company_id INT NOT NULL,
	country_id INT NOT NULL,
	department_id INT NOT NULL,
	evaluations_id INT NOT NULL,
	gender_id INT NOT NULL,
	job_id INT NOT NULL,
	FOREIGN KEY (company_id) REFERENCES companies(company_id),
	FOREIGN KEY (country_id) REFERENCES countries(country_id),
	FOREIGN KEY (department_id) REFERENCES departments(department_id)  ON UPDATE CASCADE ,
	FOREIGN KEY (evaluations_id) REFERENCES evaluations(evaluations_id),
	FOREIGN KEY (gender_id) REFERENCES genders(gender_id) ON DELETE CASCADE,
	FOREIGN KEY (job_id) REFERENCES jobs(job_id)
);

